import { useParams } from 'react-router-dom';
import React, { useState, useEffect } from 'react';
import ProductServiceInstance from '../../Services/ProductService';

const ProductInfo = () => {
    const [products, setProducts] = useState([]);
    const { name,size } = useParams();
  
  
    useEffect(() => {
      getProductsByType(name,size);
      
    }, [name,size]);
  
    const getProductsByType = (name,size) =>{
      ProductServiceInstance.getProductByNameAndSize(name,size)
          .then((response) =>{
              setProducts(response.data);
              
              console.log(response.data);
            })
            .catch((error) => {
              console.log(error);
            });
    }
  


  return (
    <div>{products[0].name}</div>
  )
}
export default ProductInfo;
